interface clickCounterProps {
    counter: number;
    questionLimit: number;
}

const ClickCounter: React.FC<clickCounterProps> = ({ counter }) => {
    return (
        <>
            <p>{counter}/{questionLimit}</p>
        </>
    );
};

export default ClickCounter;
